(1, 'Réservez Halal', 'le meilleur de la restauration halal à marseille', 'le concept en 3 étapes', 'Notre sélection ', 'les tendances ', 'C\'est halal ? ', 'À cette désormais célèbre question nous sommes la réponse, ne vous posez plus jamais la question, ne posez plus jamais cette question ! \r\nNous sommes la.\r\nTrouvez l\'ensemble des restaurants Halal de Marseille, et réservez une table.\r\nVous pouvez également commandez votre menu au moment de la réservation, ne perdez plus de temps en salle à attendre un serveur !', 'Où est ce que vous souhaitez dîner', 'Renseignez votre ville ou votre adresse et trouvez l\'ensemble des restaurants halal partenaires.', 'choisissez un restaurant', 'Sélectionnez un restaurant, découvrez sa carte et ses informations pratiques.', 'Réservez et commandez avec anticipation ', 'Réservez dans votre restaurant et soumettez même votre menu au moment de la réservation. Ne perdez plus de temps ! ', '5', '1', '3', '4', '2', '6', '500', NULL, '2017-07-06 14:57:31');
