(1, 'BCBG Boeuf Chic Bon Goût', 'bcbg-boeuf-chic-bon-gout', 'bcbgrestaurant@gmail.com', '$2y$10$yHuA9DAAxhpKAkNxMME4m.D6Cnvlq3jHvMzQx0qY/DEEQs1wPD9FS', 'Grill, 59 rue Alphonse Daudet', 'Ici nous mettons l\'accent sur une cuisine artisanale et l\'utilisation de produits frais de qualité, c\'est pourquoi : on épluche, on mijote, on grille, on poêle, on dresse ... Bref on cuisine !\r\nPour un meilleur moment et pour tous soyez ponctuels :)', 43.319295, 5.4083163, '59 rue Alphonse Daudet', 'Marseille', '13013', '0628217451', 'restaurant-3.jpg', '38', 2.00, 'oY8VL0DQFc59WlnBAURihJ9tVFKBpQib2uAnBhmrKfyXcXb9ykaR5yH419ju', '2017-06-26 09:16:03', '2018-02-25 01:45:01'),
(2, 'L\'Artiste', 'Lartiste', 'restaurant.lartiste13001@gmail.com', '$2y$10$H6SyRCP3eNENRonZAMHbc.eODu.YJLVfh.fDiJx4Pr8wwyiHQM.9i', 'Cuisine Italienne, 30 rue Saint-Saëns ', 'Restaurant familiale et authentique de cuisine italienne Halal.  \r\n   Pour un meilleur moment et pour tous soyez ponctuels :) !\r\n', 43.2934891, 5.3738173, '30 Rue Saint-Saëns', 'Marseille', '13001', '0442098784', 'restaurant-2.jpg', '26', 2.50, 'r4TZPoJoEMC2wbpSngNMg8fVzslulGhZ1xIGcraN442dfb6Z2QXdCYF9ZCKI', '2017-06-26 09:41:25', '2018-01-16 19:39:40'),
(3, 'O\'Provencal', 'oprovencal', 'o@provencal.fr', '$2y$10$OFltmGQtSsjoB6jkzDWKsus3ibeRvwT9ySB/SjT.QgZPdnz0c3fBu', 'Cuisine Provençale, 7 rue de la Palud', 'Choisissez un restaurant et un savoir faire authentique, une adresse renommée depuis plus 70 ans et une localisation en plein centre ville. Une ambiance familiale, un décor épuré, provençal et rustique. Excellent avis "Le Petit Futé".', 43.29468860000001, 5.3792428, '7 rue de la Palud', 'Marseille', '13001', '0601739620', 'restaurant-20.JPG', '0', 2.00, 'JbzuuXkGc3At32x2Q0PN3uzqvzkOtkN04F7UP3sgveKUxRb6SafI3Uk5rKWW', '2017-07-12 09:34:42', '2017-09-02 14:56:27'),
(4, 'Le Café des Artistes', 'le-cafe-des-artistes', 'lecafe@desartistes.fr', '$2y$10$rgJ1TKA5uJL5bp2uqu2p.eOl4UvU7egFhNfKEeYFGycDGkfVwWflK', 'Cuisine du monde, 40 Cours Julien', 'Une cuisine délicate et abordable au cours julien.', 43.2948364, 5.382573799999999, '40 cours julien', 'Marseille', '13006', '0620403574', 'restaurant-4.jpg', '15', 0.00, 'NDaYmd4t0k2V2MRlMwfPDn2poZ1Ss5BAW7MliEpObbbrewcE36pn8oIDWgBt', '2017-06-30 16:34:53', '2017-07-29 08:54:54'),
(5, 'La salle à manger', 'la-salle-a-manger', 'lasalle@amanger.fr', '$2y$10$mtBuoNhlGQz3C7YqeIPkIOjj7HETI.c.DBbHSfjSMW8UAKImiAyGi', 'Brunch - Bistro Halal, 56 cours Julien', 'Dans une salle au charme atypique nous vous accueillons dans une ambiance paisible et chaleureuse.\r\nSoyez à l\'heure ! ', 43.29434819999999, 5.3828284, '56 cours julien', 'Marseille', '13006', '0614467272', 'restaurant-18.jpg', '30', 2.00, 'UTiGo4uK7TSb15XBTMdsHU5pbI41RoLiT6vkALmrZ4E7wq9eti8itH8xTHk6', '2017-07-01 09:26:34', '2018-02-25 15:12:52'),
(6, 'Jazzy SoulFood', 'jazzy-soulfood', 'jazzy@soulfood.fr', '$2y$10$TRmuRLDkAAmscxA5vDCky.Um0qijNn/BTKDDTR6cIbbCyM2Q.6Wnu', 'Afro-Américain, 77 rue d\'Italie', 'Quand le Meilleur de la cuisine comorienne et américaine se rencontre ca donne un lieu unique dans la région !\r\nVenez déguster de vrais plats afro-américain ! Pour un meilleur moment et pour tous arrivez à l\'heure.', 43.287828, 5.3836263, '77 rue d\'Italie', 'Marseille', '13006', '0666995478', 'restaurant-7.jpg', '1', 2.00, 'm6gOHlOu1sMZmQZCNlRX2ahkTp4FqQ8mSkNA6bl5pvUuorQ4H1lE1K9Q7bUA', '2017-07-05 16:22:47', '2017-09-30 15:27:39'),
(7, 'NON DISPONIBLE', 'non-disponible', 'yanisberkouk@gmail.com', '$2y$10$b4hZ21iCTcIH/0vuqcOjuOhiHn/LJzFoYdSZ9fxVC4Wr2khdfA52q', '', '', 43.3838412, 5.3556987, '16 boulevard Augustin', 'Marseille', '13015', '0000000000', 'restaurant-7.jpg', '30', 2.00, 'ZSNGln4ooALZdiNkthCWp4eqOIiMid3yJ1YHMgO1p83pE5Oq9FYpLByIKGN7', '2017-07-21 15:07:37', '2017-07-21 15:11:40');
